import React from 'react'
import { Box, Stack, TextField, Typography } from '@mui/material';

const Login = () => {
    return (
        <Box>
            <Typography variant='h3' component="h3">로그인</Typography>
            <Stack>
                <TextField sx={{
                    '& .MuiInput-root': {
                        "&:hover": {
                            color: 'white'
                        }
                    },
                }} id='stanndard-basic' variant='standard'></TextField>
                <TextField id='outlined-basic' variant='outlined'></TextField>
            </Stack>
        </Box >
    )
}

export default Login;
